INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES
	(83620, 'application.yml', 'DEFAULT_GROUP', '# 公共配置地址\r\nbase:\r\n  mysql:\r\n    url: jdbc:p6spy:mysql://dev.yc.com:3306\r\n  redis:\r\n    host: dev.yc.com\r\n    port: 6379\r\n    password:\r\n# 容器配置\r\nserver:\r\n  undertow:\r\n    accesslog:\r\n      enabled: false\r\n# 项目配置\r\nmodule:\r\n  #分页配置\r\n  page-size: 20\r\n  # 验证码长度\r\n  valid-code-length: 4\r\n \r\nspring:\r\n  mvc:\r\n    throw-exception-if-no-handler-found: true\r\n\r\nmanagement:\r\n  security:\r\n    enabled: false\r\n  # 监控端口\r\n  # server.port: 9009\r\n  endpoints:\r\n    web:\r\n      # 默认/actuator\r\n      base-path: /monitor\r\n      exposure:\r\n        # 暴露所有接口\r\n        include: "*"\r\n  endpoint:\r\n    # 禁止shutdown\r\n    shutdown:\r\n      enabled: false\r\n    health:\r\n      # 展示详细的health信息\r\n      show-details: ALWAYS', '164086579457fe8a0d99a09fbb71005e', '2022-07-04 07:32:37', '2022-07-04 07:32:37', NULL, '192.168.31.244', '', '31b2a597-6609-4627-9e24-c2a8a1e4aab6', NULL, NULL, NULL, 'yaml', NULL),
	(83621, 'dubbo.yml', 'DEFAULT_GROUP', 'dubbo:\n  registry:\n    address: nacos://dev.yc.com:8858\n    parameters:\n      namespace: 31b2a597-6609-4627-9e24-c2a8a1e4aab6\n  application:\n    id: ${spring.application.name}\n    name: ${spring.application.name}\n    logger: log4j2\n    qos-enable: false\n  provider: # Dubbo 服务端配置\n    # 集群方式,可选: failover/failfast/failsafe/failback/forking\n    # cluster: failfast\n    # 远程服务调用重试次数, 不包括第一次调用, 不需要重试请设为0\n    retries: 0\n    # 远程服务调用超时时间(毫秒)\n    timeout: 60000\n    # 令牌验证, 为空表示不开启, 如果为true, 表示随机生成动态令牌\n    # token: true\n     # 服务是否动态注册, 如果设为false, 注册后将显示后disable状态, 需人工启用, 并且服务提供者停止时, 也不会自动取消册, 需人工禁用. \n    # dynamic: true\n     # 延迟注册服务时间(毫秒)- , 设为-1时, 表示延迟到Spring容器初始化完成时暴露服务\n    # delay: -1\n    # version: 1.0.0\n    # 服务提供方远程调用过程拦截器名称, 多个名称用逗号分隔\n    # filter: -exception\n  protocol:\n    name: dubbo\n    port: -1\n    #serialization: kryo', '32f52fd0c68c0cb307155ef40c6d6904', '2022-07-04 07:33:22', '2022-07-11 02:58:57', 'nacos', '192.168.31.244', '', '31b2a597-6609-4627-9e24-c2a8a1e4aab6', '', '', '', 'yaml', ''),
	(83623, 'hikari-datasource.yml', 'DEFAULT_GROUP', 'mybatis-plus:\n  mapper-locations: classpath:/mapper/*Mapper.xml\n  configLocation: classpath:/mybatis/mybatis-configuration.xml\n  global-config:\n    banner: false\n    db-config:\n      # 字段验证策略之insert\n      insert-strategy: NOT_NULL\n      # 字段验证策略之 update\n      update-strategy: NOT_NULL\n      # 字段验证策略之 select\n      select-strategy: NOT_NULL\n      # 逻辑已删除值(默认为 1)\n      logic-delete-value: 1\n      # 逻辑未删除值(默认为 0)\n      logic-not-delete-value: 0', 'd96082e93ff1095289312daa403e4569', '2022-07-04 07:35:38', '2022-07-05 07:05:22', 'nacos', '192.168.31.244', '', '31b2a597-6609-4627-9e24-c2a8a1e4aab6', '', '', '', 'yaml', ''),
	(83624, 'seata-business.yml', 'DEFAULT_GROUP', 'dubbo:\n  scan:\n    base-packages: com.yc.demo.seata\n  consumer:\n    check: false\n  cloud:\n    # 多应用，使用","分割\n    subscribed-services: seata-order-service,seata-stock-service\n  protocol:\n    name: dubbo\n    port: 20781\n#  registry:\n#    register: true\n#    subscribe: true\nspring:\n  cloud:\n    nacos:\n      discovery:\n        #服务注册到Nacos服务列表中\n        register-enabled: false\nmybatis-plus:\n  typeAliasesPackage: com.yc.demo.seata\n  typeEnumsPackage: com.yc.demo.seata\n  # 多jar包前加*号\n  mapper-locations: classpath*:/mapper/*Mapper.xml\n  configuration-properties:\n    blobType: BLOB\n    boolValue: TRUE\n    prefix:\n#feign:\n#  sentinel:\n#    enabled: true\nhikari:\n  jdbc-url: ${base.mysql.url}/seata_order?useUnicode=true&characterEncoding=utf8&useLegacyDatetimeCode=false&useJDBCCompliantTimezoneShift=true&serverTimezone=Asia/Shanghai&autoReconnect=true&failOverReadOnly=false&allowMultiQueries=true&useSSL=false&nullCatalogMeansCurrent=true\n  username: root\n  password: 255eba479a56c3570c2ac910a7f67643\n  driver-class-name: com.p6spy.engine.spy.P6SpyDriver\n  minimum-idle: 5\n  maximum-pool-size: 20\n  pool-name: Cloud-HikariCP', '1ed3cba614bdb1b2cc3df807858c9ea4', '2022-07-04 07:36:22', '2022-07-11 06:56:23', 'nacos', '192.168.31.244', '', '31b2a597-6609-4627-9e24-c2a8a1e4aab6', '', '', '', 'yaml', ''),
	(85245, 'seata-account-service.yml', 'DEFAULT_GROUP', 'dubbo:\n  scan:\n    base-packages: com.yc.demo.seata\n  consumer:\n    check: false\n  #cloud:\n    # 多应用，使用","分割\n  #  subscribed-services: \n  protocol:\n    name: dubbo\n    port: 20782\n#  registry:\n#    register: true\n#    subscribe: true\nspring:\n  cloud:\n    nacos:\n      discovery:\n        #服务注册到Nacos服务列表中\n        register-enabled: true\nmybatis-plus:\n  typeAliasesPackage: com.yc.demo.seata\n  typeEnumsPackage: com.yc.demo.seata\n  # 多jar包前加*号\n  mapper-locations: classpath*:/mapper/*Mapper.xml\n  configuration-properties:\n    blobType: BLOB\n    boolValue: TRUE\n    prefix:\n#feign:\n#  sentinel:\n#    enabled: true\nhikari:\n  jdbc-url: ${base.mysql.url}/seata_order?useUnicode=true&characterEncoding=utf8&useLegacyDatetimeCode=false&useJDBCCompliantTimezoneShift=true&serverTimezone=Asia/Shanghai&autoReconnect=true&failOverReadOnly=false&allowMultiQueries=true&useSSL=false&nullCatalogMeansCurrent=true\n  username: root\n  password: 255eba479a56c3570c2ac910a7f67643\n  driver-class-name: com.p6spy.engine.spy.P6SpyDriver\n  minimum-idle: 10\n  maximum-pool-size: 20\n  pool-name: Cloud-HikariCP', 'fc4f210f8d0c4762f01e82db6ff4c86c', '2022-07-06 03:10:09', '2022-07-11 06:56:51', 'nacos', '192.168.31.244', '', '31b2a597-6609-4627-9e24-c2a8a1e4aab6', '', '', '', 'yaml', ''),
